import { Children, useContext, useEffect, useState } from "react"
import { useParams } from "react-router"
import passServices from '../../services/pass.services'
import moviesServices from '../../services/movies.services'
import comboService from '../../services/combos.services'
import { Col, Container, Row, Button, Form, Modal } from "react-bootstrap"
import './MovieDetailsPage.css'
import { AuthContext } from "../../context/auth.context"
import ConfirmOrder from "../../components/ConfirmOrder/ConfirmOrder"
import { Link } from "react-router-dom"
const { formatDate } = require('../../utils/formatDate');


const MovieDetailsPage = () => {


    const { user } = useContext(AuthContext)

    const { movie_id } = useParams()

    const baseImageUrl = 'https://image.tmdb.org/t/p/original'

    const [movie, setMovie] = useState({})

    const [passes, setPasses] = useState([])

    const [show, setShow] = useState(false);

    const [combo, setCombos] = useState()

    useEffect(() => {
        oneMovieFetch()
        passFetch()
        fetchCombos()
    }, [])

    const handleClose = () => setShow(false);

    const handleShow = (e) => {
        e.preventDefault()
        setShow(true)
    }

    // const getPack = () => {

    //     profileServices
    //         .getPack(user._id)
    //         .then(res => console.log('compra realizada', res))
    //         .catch(err => console.log(err))
    // }

    const fetchCombos = () => {
        comboService
            .getCombos()
            .then(({ data }) => setCombos(data))
            .catch((error) => console.log(error))
    }

    const oneMovieFetch = () => {
        moviesServices
            .getOneMovie(movie_id)
            .then(({ data }) => setMovie(data))
            .catch(err => console.log(err))
    }



    const passFetch = () => {
        passServices
            .getPassByMovie(movie_id)
            .then((res) => { console.log(res); })
            .catch((err) => console.log(err))

    }


    return (
        <div className="full-container">
            {
                !combo
                    ? <h1>Loading...</h1>
                    :

                    <Container className="d-flex mt-5 ">
                        <Col className=" img-container" >
                            <Row>
                                < img className="img image" src={`${baseImageUrl}${movie.poster_path}`} alt="movie-poster" />
                            </Row>

                        </Col>
                        <Col className="details-container text-container">
                            <Row className="d-flex movie-details">
                                <h1 className="text">{movie.title}</h1>
                                <p className="text">{movie.overview}</p>
                                <p className="text">Fecha de estreno: {formatDate(movie.release_date)}</p>

                            </Row>
                            {
                                // user && passes.length !== 0
                                //     ?
                                //     <Button onClick={handleShow} className=" sesions-form-btn" variant="dark" type="submit">
                                //         Comprar entradas
                                //     </Button>
                                //     : <p className="no-sesions-form-btn" variant="danger"> No hay sesiones disponibles</p>
                                <div>
                                    {user && passes.length !== 0 ? (
                                        <button onClick={handleShow} className="sesions-form-btn" variant="dark" type="submit">
                                            Comprar entradas
                                        </button>
                                    ) : passes.length === 0 ? (
                                        <p className="no-sesions-form-btn" variant="danger">No hay sesiones disponibles</p>
                                    ) : (
                                        <Link className="sesions-form-btn"><Button>Por favor, inicia sesi√≥n para comprar entradas</Button></Link>
                                    )}
                                </div>
                            }

                        </Col>
                        <>

                            <Modal show={show} onHide={handleClose}>
                                <Modal.Header closeButton>
                                    <Modal.Title>Confirma tu pedido</Modal.Title>
                                </Modal.Header>
                                <ConfirmOrder
                                    handleClose={handleClose}
                                    passes={passes}
                                    combo={combo}
                                    movie={movie} />

                            </Modal>
                        </>



                    </Container >
            }

        </div>


    )
}

export default MovieDetailsPage
